import React, { createElement } from "react";

export const H2old = (props) =>
  createElement("h1", { className: "test-1", style: props.style }, [
    "Sample Heading",
    createElement("span", {}, "13123"),
  ]);

const H2 = () => (
  <h2 className="">
    Sample Heading <span>123</span>
  </h2>
);

class App extends React.Component {
  render() {
    // JSX
    return (
        <table>
          <thead>
            <tr>
              <th>id</th>
              <th>Name</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>id</td>
              <td>Name</td>
            </tr>
            <tr>
              <td>id</td>
              <td>Name</td>
            </tr>
            <tr>
              <td>id</td>
              <td>Name</td>
            </tr>
            <tr>
              <td>id</td>
              <td>Name</td>
            </tr>
          </tbody>
        </table>
    );
  }
}

export default App;
